countRange_1.query:
q = load "${App.Datasets.MFG_Demo_Data.FullyQualifiedName}";
q = group q by ('Time_Year', 'Time_Month');
q = foreach q generate 'Time_Year' + "~~~" + 'Time_Month' as 'Time_Year~~~Time_Month', count() as 'count';
q = group q by all;
q = foreach q generate min('count') as 'min', max('count') as 'max';
